import React from "react";
import { useNavigate } from "react-router-dom";

const PrivateRoute = ({ user, children }) => {
  const { name } = user;
  const navigate = useNavigate();
  if (!name) {
    return navigate("/signin");
  }

  return children;
};

export default PrivateRoute;
